create sequence corporativo.seq_pais increment by 1 start with 1 nomaxvalue minvalue 1 nocycle nocache;
create table corporativo.pais (seq_pais bigint not null, nom_pais varchar2(100) not null, constraint pk_pais primary key (seq_pais));
alter table corporativo.pais add constraint uk_pais_nom_pais unique (nom_pais);


SET @brasil = corporativo.seq_pais.currval;


create sequence corporativo.seq_unidade_federacao increment by 1 start with 1 nomaxvalue minvalue 1 nocycle nocache;
create table corporativo.unidade_federacao (seq_unidade_federacao bigint not null, nom_unidade_federacao varchar2(100) not null, sig_unidade_federacao varchar2(3) not null, seq_pais bigint not null, constraint pk_unidade_federacao primary key (seq_unidade_federacao));
alter table corporativo.unidade_federacao add constraint uk_unfe_sig_unidade_federacao  unique (sig_unidade_federacao, seq_pais);
alter table corporativo.unidade_federacao add constraint uk_unfe_nom_unidade_federacao  unique (nom_unidade_federacao, seq_pais);
alter table corporativo.unidade_federacao add constraint fk_pais_unfe foreign key (seq_pais) references corporativo.pais(seq_pais);

